import React from 'react'
import { UserContext, ChannelContext } from '../App'


function ComponentF() {
  return (
    <div>
      <UserContext.Consumer>
        {user => {
            return(
                <ChannelContext>
                    {user => {
                        return(
                            <div>
                                My name is {}
                            </div>
                        )
                    }}
                </ChannelContext>
            )
        }}
      </UserContext.Consumer>
    </div>
  )
}

export default ComponentF
